import React from 'react';

const FileList = ({ files, onDelete, onDownload }) => (
  <>
    <h2>Your Google Drive Files</h2>
    {files.length ? (
      <ul>
        {files.map((file) => (
          <li key={file.id}>
            {file.name}{' '}
            <button onClick={() => onDelete(file.id)}>Delete</button>
            <button onClick={() => onDownload(file.id)}>Download</button>
          </li>
        ))}
      </ul>
    ) : (
      <p>No files found.</p>
    )}
  </>
);

export default FileList;
